import React from 'react';
import data from '../asset/data';

class Navul extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            navUl: data.navList,
        };
    }

    render() {
        let { navUl } = this.state;
        return (
            <ul id="nav11">
                <li>
                    <a href="">免费课程</a>
                </li>
                <li>
                    <a href="">实战课程</a>
                </li>
                <li>
                    <a href="">就业班</a>
                </li>
                <li>
                    <a href="">专栏</a>
                </li>
                <li>
                    <a href="">猿问</a>
                </li>
                <li>
                    <a href="">手记</a>
                </li>
            </ul>
        )
    }

}

export default Navul;
